import React from 'react';
import './contacts.css'
import arow from '../../../images/Arrow.png'

const Contacts = () => {
    return (
        <section className='contacts_generall'>
            <h2>Напишите нам </h2>
            <img height={100} src={arow} alt="" />
        </section>
    );
};

export default Contacts;
